import React, { Component } from 'react';
import './Schedule.css';

/** The Schedule Viewer **/

class Schedule extends Component {


    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <p>
                        Hello World
                    </p>
                    <a
                        className="App-link"
                        href="https://reactjs.org"
                        target="_blank"
                        rel="noopener noreferrer"
                    >
                    </a>
                </header>
            </div>
        );
    }
}

const ClassBlock = () => {
    <div className="ClassBlock">
    </div>
}

export default Schedule;
